import React from 'react';
import styled from '@emotion/styled';
import {Row, Col} from 'reactstrap';

const Nombre = styled.p``;

const Vinedo = styled.p``;

const Precio = styled.p``;

const AgregarBtn = styled.button`
    background-color: transparent;
    font-weight: bold;
    border: none;
    color: var(--colorAzul);
    transition: all .3s ease;
    text-align: center;
    &:hover{
        transform: rotate(90deg);
    }
    &:focus {
        outline: none;
    }
`;

const VinoIndividual = () => {
    return (
        <Row>
            <Col>
                <AgregarBtn
                
                >+</AgregarBtn>
            </Col>
            <Col>
                <Nombre>Laborum de Parcela Finca Alto Los Culses 2017</Nombre>
                <Vinedo>El Porvenir de Cafayate, Cafayate</Vinedo>
            </Col>
            <Col>
                <Precio>145</Precio>
            </Col>
        </Row>
    );
}
 
export default VinoIndividual;
